import React, { useState } from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import "./App.css";
import Form from "./components/Form";
import Table from "./components/Table";

function App() {
  const navigate = useNavigate();
  const [selectedJoke, setSelectedJoke] = useState(null);

  const handleEdit = (joke: React.SetStateAction<null>) => {
    setSelectedJoke(joke);
    navigate(`/form/${joke.id}`);
  };

  const handleFormClose = () => {
    setSelectedJoke(null);
    navigate("/");
  };

  const handleFormSubmit = (updatedJoke: any) => {
    // Handle form submission logic here
  };

  const handleFormDelete = () => {
    // Handle form delete logic here
  };

  return (
    <Routes>
      <Route
        path="/"
        element={<Table />}
      />
      <Route
        path="/form/:id"
        element={
          <Form
            initialValues={selectedJoke}
            onClose={handleFormClose}
            onSubmit={handleFormSubmit}
            onDelete={handleFormDelete}
          />
        }
      />
    </Routes>
  );
}

export default App;
